        getDocumentsByType: this.connection.prepare("\n        SELECT id, uuid, title, sender_unit, sender_number,\n               original_number, drafting_unit, created_at,\n               review_leader,secrecy_level,crgency_level,secrecy_period\n        FROM documents \n        WHERE doc_type = @doc_type\n        ORDER BY created_at DESC"),
        getDocumentById: this.connection.prepare("\n        SELECT * FROM documents WHERE uuid = @uuid"),
        updateDocument: this.connection.prepare("\n        UPDATE documents SET\n          sender_unit = @sender_unit,\n          sender_number = @sender_number,\n          original_number = @original_number,\n          drafting_unit = @drafting_unit,\n          title = @title,\n          review_leader = @review_leader,\n          secrecy_level = @secrecy_level,\n          crgency_level = @crgency_level,\n          secrecy_period = @secrecy_period\n        WHERE uuid = @uuid"),
        deleteDocument: this.connection.prepare("\n        DELETE FROM documents WHERE uuid = @uuid"),
        /******************** 批注操作 ********************/
        addAnnotation: this.connection.prepare("\n        INSERT INTO annotations (\n          annotate_type, processing_mode, uuid, \n          content, annotate_note, author_id,\n          annotate_at, distribution_scope, distribution_at\n        ) VALUES (\n          @annotate_type, @processing_mode, @uuid, \n          @content, @annotate_note, @author_id,\n          @annotate_at, @distribution_scope, @distribution_at\n        )"),
        getAnnotations: this.connection.prepare("\n        WITH grouped_annotations AS (\n          SELECT \n            a.id,\n            a.processing_mode,\n            a.annotate_at,\n            a.created_at,\n            a.content,\n            a.annotate_note,\n            a.distribution_scope,\n            a.distribution_at,\n            au.name AS author_name,\n            CASE \n              WHEN a.processing_mode = 3 \n                THEN DATE(a.annotate_at)\n              ELSE \n                CAST(a.id AS TEXT)\n            END AS group_key\n          FROM annotations AS a \n          INNER JOIN authors AS au ON a.author_id = au.id\n          WHERE a.uuid = @uuid AND a.annotate_type = @annotate_type\n        )\n        SELECT \n          CASE \n            WHEN processing_mode = 3 \n              THEN GROUP_CONCAT(id, ',')  -- \u4F7F\u7528CTE\u4E2D\u7684id\u5217\uFF0C\u800C\u975Ea.id\n            ELSE \n              group_key\n          END AS group_id,\n          processing_mode,\n          DATE(annotate_at) AS annotate_date,\n          MAX(created_at) AS latest_date,\n          GROUP_CONCAT(author_name, ',') AS author_names,\n          content,\n          annotate_note,\n          distribution_scope,\n          distribution_at\n        FROM grouped_annotations  -- \u6B64\u5904\u76F4\u63A5\u5F15\u7528CTE\u7684\u7ED3\u679C\u5217\n        GROUP BY group_key, processing_mode\n        ORDER BY latest_date DESC;\n      "),
        deleteAnnotate: this.connection.prepare("\n        DELETE FROM annotations \n        WHERE id = @id;\n        "),
        deleteAnnotates: this.connection.prepare("\n        DELETE FROM annotations \n        WHERE id IN (\n          SELECT CAST(value AS INTEGER) \n          FROM json_each('[' || @group_ids || ']')\n        );\n        "),
        /******************** 作者操作 ********************/
        createAuthor: this.connection.prepare("\n        INSERT INTO authors (name, unit) \n        VALUES (@name, @unit)\n        RETURNING id\n      "),
